textOriginal:
Se você é a favor:
Da ideologia de gêneros
Que tua filha seja estuprada em um banheiro por um macho que se diz ser mulher;
Se você é a favor do aborto
Que é contra todos os princípios da vida;
Se você é a favor que um ladrão roube teu celular e que isso seja normal;
Se você é a favor que a tua casa, caso tenha um quarto vazio, seja colocado um estranho para morar com tua família;
Se você é a favor da velha política do toma lá da cá;
Se você é a favor do fechamento de todas as igrejas, não importa a religião, católica ou evangélica;
Se você é a favor do Comunismo (Comunismo: comum a todos, só não aos que estão no poder);
Resumindo
Se você é a favor do mal
Então você sabe em quem vai votar agora no dia 30/10/2022.
Walter Gomes de Sousa
Parquelàndia, Fortaleza, Ceará, Nordeste, BRASIL.
